import React from 'react'
import {Header, Item, Label } from 'semantic-ui-react'
import { IAffilie } from '../../../app/models/affilie'
import {format} from 'date-fns'
import local from 'date-fns/locale/fr'




const AyantDroits : React.FC<{ affilie: IAffilie }> = ({ affilie }) =>
{

    return (

        <Item.Group divided>


        <Item>
      <Item.Header>Conjoint</Item.Header>
      {affilie.conjoints.map(conj =>

          <Item.Content verticalAlign='middle'>


        {conj.nom+' '+conj.prenom}
        {conj.dateNaissance+' '+conj.observation}


          </Item.Content>
          )}

    <Item.Header>Enfants</Item.Header>
      {affilie.enfants.map(enf =>

          <Item.Content verticalAlign='middle'>


        {enf.nom+' '+enf.prenom}
        {enf.dateNaissance+' '+enf.observation}


          </Item.Content>
          )}

        </Item>


      </Item.Group>




    )

}

export default AyantDroits
